import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import logo from "../../src/assets/images/logo.png"; // Tell webpack this JS file uses this image

console.log(logo); // /logo.84287d09.png

class Navigation extends Component {
  render() {
    return (
      <div>
        <div className="navigation">
          <NavLink exact="true" to="/" className="nav-home">
            Home
          </NavLink>
          <NavLink exact="true" to="/a-propos" className="nav-about">
            A propos de moi
          </NavLink>
          <img src={logo} alt="logo" />
          <NavLink exact="true" to="/atelier" className="nav-workshop">
            Mon atelier
          </NavLink>
          <NavLink exact="true" to="/contact" className="nav-contact">
            Contact
          </NavLink>
        </div>
      </div>
    );
  }
}

export default Navigation;
